import useForm from './hooks/useForm';
import Input from './components/Input';
import Card from './components/Card';


function App() {
  const [form, handleChange] = useForm({
    name: '',
    lastName: '',
  });

  console.log(form);

  return (
    <Container>
      <Card>
        <form>
          <Input 
            label='Name'
            name='name'
            value={form.name}
            onChange={handleChange}
          />
          <Input 
            label='Last Name'
            name='lastName'
            value={form.lastName}
            onChange={handleChange}
          />
        </form>
      </Card>
    </Container>
  );
}

export default App;
